import React from 'react';
import './DevelopmentSuite.css';
const JavaScript = require('./../../../../assets/javascript.png');

function DevelopmentSuite() {
    return (
      <div className="row" style={{paddingBottom: "100px"}}>
          <div className="two-col-format-column development-suite-container" style={{paddingLeft: "10vw"}}>
              <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript" class="large polaroid img1">
                  <img src={JavaScript} alt="javascript logo"/> <span style={{textAlign: "center"}}>Javascript</span>
              </a>
          </div>
          <div className="two-col-format-column" style={{paddingRight: "10vw"}}>
              <p>
                  Next, it was time to select the suite of developmer tools to make the website come to life.
              </p>
          </div>
      </div>
    );
}

export default DevelopmentSuite;
